module.exports = {
  confirmSassContent: sass(),
  confirmTemplateContent: template(),
  ustcLogoBufferBase64: logo(),
};

function sass() {
  return `
html {
  // to ensure background-colors display in pdf
  -webkit-print-color-adjust: exact;
}

body {
  font-family: sans-serif;
  font-size: 12px;

  .page-container {
    position: relative;
    margin: 0.5in;

    .margin-top-80 {
      margin-top: 80px;
    }

    .margin-bottom-20 {
      margin-bottom: 20px;
    }

    .float-left {
      float: left;
    }

    .float-right {
      float: right;
    }

    .text-center {
      text-align: center;
    }

    .width-third {
      width: 33%;
    }

    .width-half {
      width: 50%;
    }

    h1, h2 {
      font-family: serif;
    }

    h2 {
      font-weight: normal;
    }

    .logo {
      position: absolute;
      top: 0px;
      height: 100px;
      width: 100px;
    }

    .clear {
      clear: both;
    }

    .link {
      text-decoration: underline;
    }

    .info-box {
      margin-bottom: 20px;
      border: 1px solid #D6D7D9;

      h3 {
        background-color: #f1f1f1;
        border-bottom: 1px solid #D6D7D9;
        padding: 10px;
        margin-bottom: 0;
        margin-top: 0;
      }

      p {
        padding: 10px;
        margin: 0;
      }
    }
  }

  .address {
    position: absolute;
    top: 9.5in;
    left: 1.0in;
  }

}
  `;
}
function template() {
  return `
<!doctype html>
<html lang="en">

<head>
  <meta charset="utf-8">
  <title>NOTIFICATION OF RECEIPT OF PETITION, U.S. Tax Court Electronic Filing and Case Management System</title>
  {{{styles}}}
</head>

<body>

  <body>
    <div class="page-container">
      <img class="logo" src="{{{logo}}}">
      <h1 class="text-center">United States Tax Court</h1>
      <p class="text-center">
        400 Second Street, N.W. <br />
        Washington D.C. 20217
      </p>

      <p class="text-center">{{todaysDate}}</p>

      <h2 class="text-center clear">NOTIFICATION OF RECEIPT OF PETITION</h2>

      <p class="float-left width-half">{{caseTitle}}</p>
      <p class="float-right">Docket Number: {{docketNumber}}</p>

      <p class="clear margin-top-80">The Court received and filed your petition on {{receivedAtFormatted}} and served it
        on respondent on {{servedDate}}.</p>
      <p class="margin-bottom-20">
        (X) Filing Fee Paid. <br />
        (X) Request for Place of Trial at {{preferredTrialCity}}.
      </p>

      <div class="info-box">

        <h3>Your Docket Number: {{docketNumber}}</h3>
        <p>Your docket number is displayed. Please use this docket number on all papers and correspondence that you send
          to
          the Tax Court. Do not include your Social Security or Taxpayer Identification numbers on any documents you
          file
          with the Court, except on Form 4.</p>
      </div>

      <div class="info-box">
        <h3>Internet Access:</h3>
        <p>To obtain further information about proceeding in the Tax Court, please visit
          <b class="link">www.ustaxcourt.gov</b>
          and select “Taxpayer Information”.</p>
      </div>
      <div class="info-box">
        <h3>Change of Address:</h3>
        <p>You must notify the Clerk of the Court if you change your address. If you filed your petition in paper,
          see Tax
          Court Form 10, Notice of Change of Address, under “Forms” on the Tax Court’s Website at
          <b class="link">www.ustaxcourt.gov</b>
          . If you filed your petition electronically, you may update your address under the “Case Information” tab
          in your
          case online. Failure to notify the Clerk of the Court of a change of your address can mean you do not
          receive
          notices and documents essential to your case and can lead to dismissal of your case.
        </p>
      </div>
      <p class="float-right width-third">
        Stephanie A. Servoss
        <br />
        Clerk of the Court
      </p>

      <hr class="clear margin-top-80" />
    </div>

    <div class="address">
      {{name}} <br />
      {{address1}} <br />
      {{#if address2}}
      {{address2}}<br />
      {{/if}}
      {{#if address3}}
      {{address3}}<br />
      {{city}}, {{state}} {{postalCode}}
      {{#if countryName}}
      {{countryName}}
      {{/if}}
      {{else}}
      {{city}}, {{state}} {{postalCode}}<br />
      {{#if countryName}}
      {{countryName}}
      {{/if}}
      {{/if}}
    </div>
  </body>

</html>
  `;
}
function logo() {
  return 'data:image/png;base64,';
}
